def recommend_item(finduser):
    #가장 큰 값
    sorted_matrix=sorted(sim_matrix[finduser],reverse=True)[0:10]
    # print(sorted_matrix)
    #가장 유사한 N명의 유저를 선정
    most_sim_user=[]
    for i in sorted_matrix:
        # 가장 큰 값의 인덱스 즉 가장 유사한 사용자 인덱스
        most_sim_user.append(list(filter(lambda x:sim_matrix[finduser][x]==i,range(len(sim_matrix[finduser])))))
    # print(most_sim_user)
    recommend_item=[]
    for i in most_sim_user:
        for j in i:
            if len(i)==1:
                r=empty_dic
                for k in range(ITEM):
                    r[ITEM_DIC[k]]=rating_matrix[j][k]
                #value 값 기준으로 딕셔너리 정렬
                s_dic=sorted(r.items(),key=operator.itemgetter(1),reverse=True)
                #상위 3개의 아이템 고르고 중복 제거(set 집합 활용)
                recommend_item.append(s_dic[0][0])
                recommend_item.append(s_dic[1][0])
                recommend_item.append(s_dic[2][0])
                recommend_item=set(recommend_item)
                recommend_item=list(recommend_item)
        if len(recommend_item)>=NUM_OF_RECOMMENDED_ITEMS:
            break

    # print(recommend_item)
    return recommend_item

#정밀도
def precision(recommended_item,preferred_item):
    set1=set(recommended_item)
    set2=set(preferred_item)
    return len(set1&set2)/len(recommended_item)

#재현율
def recall(recommended_item,preferred_item):
    set1 = set(recommended_item)
    set2 = set(preferred_item)
    return len(set1&set2)/len(preferred_item)


